import React, { useState } from "react";
import "./Auth.css";
import { MDBContainer, MDBRow, MDBCol, MDBInput, MDBBtn } from "mdbreact";
import CardCatalog from "../../global/components/front-end-comps/CardCatalog";

const Auth = () => {
  const [email, setEmail] = useState();
  const [password, setPassword] = useState();

  const authSubmitHandler = (e) => {
    e.preventDefault();
    const result = {
      email,
      password,
    };
    // console.log(result);
  };

  return (
    <CardCatalog className="log-form">
      <MDBContainer>
        <MDBRow>
          <MDBCol>
            <form className="needs-validation" onClick={authSubmitHandler}>
              <p className="h5 mb-5 text-center">Login</p>
              <div className="grey-text">
                <MDBInput
                  id="email"
                  label="Email"
                  group
                  icon="envelope"
                  type="email"
                  validate
                  error="wrong"
                  success="right"
                  // className="form-control"
                  onChange={(e) => setEmail(e.target.value)}
                />
                <MDBInput
                  id="password"
                  label="Password"
                  icon="lock"
                  group
                  type="password"
                  validate
                  // className="form-control"
                  onChange={(e) => setPassword(e.target.value)}
                />
              </div>
              <div className="text-center rounded-0">
                <MDBBtn type="submit">LOGIN</MDBBtn>
              </div>
            </form>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </CardCatalog>
  );
};

export default Auth;
